/////////////////////////////////////// CHART CONFIGURATION
const chartConfig = {
  width: 1900,
  height: 870,
  timeScale: {
    timeVisible: true,
    secondsVisible: false,
    borderColor: "#D1D4DC",
  },
  rightpriceScale: {
    scaleMargins: {
      top: 0.2,
      bottom: 0.25,
    },
    mode: 1,
	  borderColor: 'rgba(197, 203, 206, 0.8)',
    borderVisible: false,
  },
  leftPriceScale: {
		visible: false,
    borderColor: 'rgba(197, 203, 206, 1)',
	},
  handleScale: {
    axisPressedMouseMove: {
      time: true,
      price: true,
    }
  },
  layout: {
    backgroundColor: "#131722",
    textColor: "#d1d4dc",
  },
  grid: {
    vertLines: {
      color: "rgba(42, 46, 57, 0)",
      style: LightweightCharts.LineStyle.Dotted,
    },
    horzLines: {
      color: "rgba(42, 46, 57, 0.6)",
      style: LightweightCharts.LineStyle.Dotted,
    },
  },
  crosshair: {
    mode: LightweightCharts.CrosshairMode.Normal,
},
};

/////////////////////////////////////// CHART CREATION
const chart = LightweightCharts.createChart(root, chartConfig);

/////////////////////////////////////// CANDLES
//let candlestickSeries = null;
candlestickSeries = chart.addCandlestickSeries({ priceScaleId: 'right' });
candlestickSeries.setData(candle)

/////////////////////////////////////// ADD VOLUME
const volumeStudiesVolumeSeries = chart.addHistogramSeries({
  color: "#26a69a",
  priceFormat: {
    type: "volume",
  },
  priceScaleId: "",
  scaleMargins: {
    top: 0.8,
    bottom: 0,
  },
});

const toggleVolumeBars = toggleShow(volumeStudiesVolumeSeries, volumes);
toggleVolumeBars();

/////////////////////////////////////// SMA
const smaLine = chart.addLineSeries({
	color: 'rgba(4, 111, 232, 1)',
	lineWidth: 2,
});

// const toggleSMALegend = () => smaLegend.classList.toggle("--hidden");
